import React from "react"

// Titre, localisation et tag de chaque logement
export default function HeaderLogement(props){
    return (
        <div>
            <h1>{props.title}</h1>
            <p>{props.location}</p>
            <div>
                {props.tags.map((tag, index) => 
                    <p key={index}>{tag}</p>
                )}
            </div>
        </div>
    )
}
